import './videoitem.css'
import React, {Component} from 'react'


class VideoItem extends Component {
    render() {
        return(
            <div className='videoitem-view'>
                <image src={this.props.itemvalue.videoImg.url} />
            </div>
        )
    }
}

export default VideoItem;
